export async function callForUser(accessToken){

    const headers = new Headers();
    const bearer = `bearer ${accessToken}`;
    headers.append("Authorization", bearer);

    const options = {
        method: "GET",
        headers: headers
    };
    const endpoint = "https://graph.microsoft.com/v1.0/users?$top=999";

    return fetch(endpoint, options)
        .then(response => response.json())
        .catch(error => console.log(error))
}

export async function callForNextUser(accessToken, odata){

    const headers = new Headers();
    const bearer = `bearer ${accessToken}`;
    headers.append("Authorization", bearer);

    const options = {
        method: "GET",
        headers: headers
    };
    const endpoint = odata;

    return fetch(endpoint, options)
        .then(response => response.json())
        .catch(error => console.log(error))
}

export async function callForEvent(accessToken, user){

    const headers = new Headers();
    const bearer = `bearer ${accessToken}`;
    headers.append("Authorization", bearer);

    const options = {
        method: "GET",
        headers: headers
    };

    const u = user.userPrincipalName;
    const endpoint = "https://graph.microsoft.com/v1.0/users/{user}/event" ;

    return fetch(endpoint, options)
        .then(response => response.json())
        .catch(error => console.log(error))
}
